<TD style="PADDING-BOTTOM: 15pt; PADDING-LEFT: 15pt; WIDTH: 100%; PADDING-RIGHT: 15pt; BACKGROUND: #d6d6d6; PADDING-TOP: 15pt" width="100%">

<P class=MsoNormal><SPAN style="FONT-FAMILY: Arial; FONT-SIZE: 10pt">Zusätzlich zu den unten angeführten "Angaben zu Zahlung und Versand" gelten die folgenden Zahlungs- und Versandbedingungen:<BR><BR>Die Lieferung der Ware erfolgt grundsätzlich - sofern nichts anderes vereinbart ist - gegen Vorauskasse und auf dem Versandwege. <BR><BR>Der Kunde hat eine Selbstabholung bis spätestens zwei Werktage nach Ende der Auktion über obige Kontaktdaten anzuzeigen. Bei vereinbarter Selbstabholung hat die Abholung innerhalb von 14 Tagen nach <SPAN class=SpellE>Auktionsende</SPAN> zu erfolgen.<BR><BR>Teillieferungen sind zulässig, soweit sie dem Kunden zumutbar sind.<BR><BR>Weitere Einzelheiten zu Zahlung und Versand finden Sie in den AGB, die sie in der "<SPAN class=SpellE>textarea</SPAN>" am Ende dieser Website einsehen können.</SPAN><o:p></o:p></P></TD></TR></TABLE>

