<P style="TEXT-ALIGN: center" align=center><SPAN style="FONT-FAMILY: Arial; FONT-SIZE: 10pt">Bei Peter Wolf Antiquitäten handelt es sich um einen kleinen Familienbetrieb wir sind zuverlässig, schnell, professionell und freundlich.</SPAN><o:p></o:p></P>

<P style="TEXT-ALIGN: center" align=center><SPAN style="FONT-FAMILY: Arial; FONT-SIZE: 10pt">Wir sind&nbsp;Verkaufsagent</SPAN><o:p></o:p></P>

<P style="TEXT-ALIGN: center" align=center><SPAN style="FONT-FAMILY: Arial; FONT-SIZE: 10pt">Innerhalb 24 Stunden nach <SPAN class=SpellE>Auktionsende</SPAN> erhalten Sie eine Email mit einem Link der Sie durch die weitere Kaufabwicklung mit <SPAN class=SpellE>AuktionMaster</SPAN> führt</SPAN><o:p></o:p></P>

<P style="TEXT-ALIGN: center" align=center><SPAN style="FONT-FAMILY: Arial; FONT-SIZE: 10pt">Über den Versand Ihres Artikels werden Sie per Email benachrichtigt. </SPAN><o:p></o:p></P>

<P style="TEXT-ALIGN: center" align=center><SPAN style="FONT-FAMILY: Arial; FONT-SIZE: 10pt">Den Zahlungseingang bestätigen wir ebenfalls per Email. </SPAN><o:p></o:p></P></TD></TR></TABLE>

