<P><B><SPAN style="FONT-FAMILY: Arial; FONT-SIZE: 10pt">Bezahlung und <SPAN class=SpellE>und</SPAN> Versand </SPAN></B><o:p></o:p></P>

<UL type=disc>

<LI style="mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; mso-list: l0 level1 lfo1; tab-stops: list 36.0pt" class=MsoNormal><SPAN style="FONT-FAMILY: Arial; FONT-SIZE: 10pt">Nach <SPAN class=SpellE>Auktionsende</SPAN> erhalten Sie von&nbsp;uns eine Email mit einem Link der Sie zur weiteren Kaufabwicklung mit </SPAN><SPAN style="FONT-FAMILY: Arial; FONT-SIZE: 10pt"><SPAN class=SpellE>AuktionMaster</SPAN> </SPAN><SPAN style="FONT-FAMILY: Arial; FONT-SIZE: 10pt">führt </SPAN><o:p></o:p>

<LI style="mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; mso-list: l0 level1 lfo1; tab-stops: list 36.0pt" class=MsoNormal><SPAN style="FONT-FAMILY: Arial; FONT-SIZE: 10pt">Sie werden über den Versand des Artikels per Email verständigt </SPAN><o:p></o:p>

