INSERT Items(ID,Titel,Categorie,Postcode,Locatie,Land,Verkoper,Prijs,Valuta,Conditie,Thumbnail,Beschrijving) VALUES (261665687822,'Heineken variation  # 6 of 18 different cans',34742,'6102AB','Nederland','NL','275mlcollector','1.0','EUR','','img261665687822.jpg','<p><font size="5">one of 18 different Heineken cans, for the specialized collectors</font></p><p><font face="Verdana"><font size="4">More information see website<br></font></font></p><p><font face="Verdana"><font size="4">Unter das motto; <font color="#00008b">"Diese 
bierdose kann besser bei dir auf''s regal stehen dann bei mir auf den 
dachboden"</font> biete ich verschiedene bierdosen zu verkauf (oder tausch) an, 
teilweise aus meine privatsammlung und teilweise tauschdosen. </font></font></p>
<p><font face="Verdana"><font size="4">Under the motto; <font color="#00008b">"This 
can is better off on your shelves than on my attic"</font> I am offering several 
cans on ebay for sale (or trade), a part of them are beercans from my collection 
and a part of them are traders. </font></font></p>
<p><font face="Verdana"><font size="2"><a href="http://cgi6.ebay.de/ws/eBayISAPI.dll?ViewSellersOtherItems&amp;userid=275mlcollector&amp;include=0&amp;since=-1&amp;sort=3&amp;rows=50&amp;sspageName=DB:OtherItems" target="_blank">Andere Artikel des Verkäufers</a> ansehen</font></font></p>
<p><font face="Verdana">&nbsp;Dose ist in sehr guter zustand, kann aber leichte 
gebraucherspuren haben. </font></p>
<p><font face="Verdana"><strong>Versandkosten</strong>; Genaue versandkosten 
werden nach beenden der auktion genau berechnet. </font></p>
<p><font face="Verdana"><font size="2">Die post in der Niederlanden ist relativ 
teuer, ich würde es gerne anders sehen aber ich kann nichts dran ändern. Das 
billigste tarif für ein paket bis 2 kilo ist €6,75 (versand in der Niederlanden) 
und das teuerste tarif ist €24,30 für weltweiter versand inclusive Track und 
Trace (€18,05 ohne Track und Trace, bei dieser wahl gillt: eigenes risiko) 
</font></font></p>
<p><font face="Verdana">Eventuelle fragen werde ich natürlich gerne beantworten.&nbsp;</font></p>
<p><font face="Verdana">Kombinierter versand mehrere gewonnene artikel ist kein 
problem. </font></p>
<p><font face="Verdana">Für das billigste versand tarif können ungefähr 20 dosen 
verschickt werden. </font></p>
<p align="center"><font face="Verdana"><strong>Geld Sparen??; &nbsp;</strong><font color="#00008b">Da ich noch viele bierdosen brauche für meine sammlung von 9 2/3 
fl oz bierdosen, ist auch jede dose nach gewinnen der auktion zu tauschen gegen 
eine dose auf meiner such-liste oder wantlist. Diese liste kann mann finden und 
herunterladen auf; </font></font></p>
<p align="center"><font face="Verdana"><font color="#00008b"><a href="http://www.rons275mlbeercans.nl"><strong>www.rons275mlbeercans.nl</strong></a> 
</font></font></p>
<p><font face="Verdana"><font size="2">Wenn eventuell getauscht wird dann zahle ich 
die versandkosten für Ebay dosen und deine kosten sind nur die tauschdose(s) und 
versandkosten nach mir. Billiger geht’s nicht. Auf dieser website finden sie 
noch mehr bierdosen für den verkauf.</font> </font></p>
<p><font size="1" face="Verdana">Aufgrund des neuen Sachmängelrechts (ehemals 
"Gewährleistung"), das seit dem 01.01.2002 Gültigkeit besitzt, gilt für 
gebrauchte und neue Waren, auch beim Verkauf zwischen Privatpersonen, eine 24 
Monate dauernde Garantie als vereinbart, sofern diese nicht ausdrücklich 
ausgeschlossen wird. Ich verkaufe die hier angebotene Ware als Privatperson und 
schließe diese Sachmängelhaftung aus. Daher ist diese Auktion an folgende 
Bedingungen gebunden: Der Artikel wird "so wie er ist" von Privat verkauft, dies 
bedeutet: Mit der Abgabe eines Gebotes erklären Sie sich ausdrücklich damit 
einverstanden, auf die Ihnen gesetzlich zustehende Garantie/Gewährleistung bei 
Gebrauchtwaren völlig zu verzichten. Sie kaufen auf eigenes Risiko, Umtausch 
oder Rückgabe sind ausgeschlossen. Jegliche Haftung bei Verlust oder 
Transportschäden obliegt ab Versand beim Empfänger. Entsprechende Regulierungen 
bei versichertem Versand sind laut Bestimmungen der Deutschen Post (gilt auch 
für Paketdienste) ebenfalls ausschließlich durch den Empfänger zu beantragen. 
Offensichtliche Schäden am Paket und an der Ware sind vom Zusteller bestätigen 
zu lassen. Bitte stellen Sie ihre Fragen VOR Abgabe eines Gebotes. Mit der 
Abgabe eines Gebotes erklären Sie sich ausdrücklich mit diesen Regeln 
einverstanden. Bieten Sie nicht, wenn Sie mit diesen Regeln nicht einverstanden 
sind. </font></p>
<p><font face="Verdana">Under the motto; <font color="#00008b">"This can is better 
off on your shelves than on my attic"</font> I am offering several cans on ebay 
for sale (or trade), a part of them are beercans from my collection and a part 
of them are traders. </font></p>
<p><font face="Verdana"><strong><font color="#ff0000">Important!!;</font></strong> 
Shipping costs shown at EBAY can be incorrect as I must fill in this option. 
</font></p>
<p><font face="Verdana"><strong><font color="#ff0000">Important:</font></strong> 
Wait with payment untill you receive my invoice wich will be send within 24 
hours after auction has closed Shipping costs outside the Netherlands are 
relative expensive, don’t blame me for that. I don’t make these prices, 
otherwise it would be much cheaper. </font></p>
<p><font face="Verdana">Costs depends on the buyer location and will be calculated 
after the auction is closed. </font></p>
<p><font face="Verdana"><strong>Examples;</strong> Shipping from the Netherlands 
to the United Kingdom will be ₤12,00 (0-2 kilo) Shipping from the Netherlands to 
the United States will be $33 ($25 without Track and Trace) Without Track and 
Trace is cheaper but at your own risk </font></p>
<p align="center"><font face="Verdana"><strong>SAVE MONEY?;</strong> As I do need 
lots of 9 2/3 fl oz cans for my collection, every won item can be traded for a 
can listed on my wantlist. You can find and download my wantlist at; </font></p>
<p align="center"><font face="Verdana"><a href="http://www.rons275mlbeercans.nl"><strong>www.rons275mlbeercans.nl</strong></a><strong> 
</strong></font></p>
<p><font size="2" face="Verdana">On this website you will find more cans for sale In 
case of trading I will pay shipping cost for sending my cans to you and you pay 
shipping costs for sending trade can to me. (total costs for you; trade can(s) + 
shipping costs to the Netherlands) I will gladly combine shipping on any other 
items you bid on. (about 20 cans can be send in one box for the same price as 1 
can) </font></p>
<p><font face="Verdana"><font size="1">Ebay Policy: The value of the item is in the 
collectible container, not its contents. 2. If the container has not been opened 
and any incidental contents are not intended for consumption. 3. The item is not 
available at any retail outlet, and the container has a value that substantially 
exceeds the current retail price of the alcohol in the container. 4. The seller 
will take all appropriate steps to ensure that the buyer is of lawful age in the 
buyer and seller''s jurisdiction (generally 21 years of age). 5. Buyers and 
sellers both ensure that the sale complies with all applicable laws and shipping 
regulations. This is an EMPTY collectible container.</font></font><font face="Verdana"><font color="#ffffff">Beer, beercan, beercans, bierblikje, blechdosen, bierdose, 
bierdosen, lattine, birra, ölburk, burk, biere bidon, 9 2/3, 275ml, conetop, 
cone-top, flattop, flat top, straight steel, crimped steel, guinness, watneys, 
tsingryds, whitbread, foreign, latas&nbsp;</font></font><font face="Verdana"><font color="#d2d2d2"> </font></font></p><font color="#ffffff" size="1"> </font><span style="font-family: &quot;Bookman Old Style&quot;,&quot;serif&quot;;"><font size="1"> </font></span>

font face="Verdana"')
