Historischer Bierkrug, wie ihn die alten Kelten benutzt haben. Dieser
Bierseidel wurde aus einheimischem Holz der Süßkirsche oder Eiche hergestellt
und anschließend mit lebensmitteltauglichem Öl behandelt, so dass man
bedenkenlos daraus trinken kann. Der Bierhumpen fasst etwa 0,5 Liter.</span><span style="font-size:12.0pt;line-height:115%;
font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;
