Sie benötigen andere Mengen ? Kein Problem, fragen Sie uns einfach. Wir
erstellen Ihnen zu jeder gewünschten Menge ein individuelles Angebot.<br>
<br>
<b>Lieferzeit:</b><br>
Unsere Waren sind alle grundsätzlich sofort ab Lager vorrätig und bereit für
den Versand an Sie. Bei größeren Mengen empfehlen wir jedoch kurz vor dem Kauf
den Bestand abzufragen. Dies können Sie entweder per E-Mail unter
info@holz-kaufhaus.de oder telefonisch unter 0151 17878332 bzw. +49 151
17878332.<br>
