<!-- :::::::::::::::::::::::::::::::::::: item description starts here :::::::::::::::::::::::::::::::::::::::: -->
<div><p style="margin: 0px 0px 14px; text-align: center;"><b><font color="#101010" face="Arial" size="4"><span style="font-weight: inherit; line-height: normal;">Relief Bierkrug mit&nbsp;</span><span style="line-height: normal;">½</span><span style="font-weight: inherit; line-height: normal;">&nbsp; Liter Eichung und Zinndeckel&nbsp;</span></font></b></p><p style="font-size: 18px; font-weight: inherit; margin: 0px 0px 14px; text-align: center; line-height: normal; font-family: Arial; color: rgb(16, 16, 16);"><b>Maße:</b></p><p style="font-size: 18px; font-weight: inherit; margin: 0px; text-align: center; line-height: normal; font-family: Arial; color: rgb(16, 16, 16);">Boden Dm 9.8 cm - Gesamthöhe 17 cm&nbsp;</p><p style="font-size: 18px; font-weight: inherit; margin: 0px; text-align: center; line-height: normal; font-family: Arial; color: rgb(16, 16, 16); min-height: 21px;"><br></p><p style="font-size: 18px; font-weight: inherit; margin: 0px 0px 13px; text-align: center; line-height: normal; font-family: Arial; color: rgb(16, 16, 16);">&nbsp;<b>Zustand:</b>&nbsp;</p><p style="font-size: 18px; font-weight: inherit; margin: 0px 0px 14px; text-align: center; line-height: normal; font-family: Arial; color: rgb(16, 16, 16); min-height: 21px;">Oberer Rand mit Chip. Spitze des Zinndeckels wohl beschädigt, der Deckel ist insgesamt etwas „ramponiert“. Krug sonst normale altersbedingte Gebrauchsspuren - siehe Fotos</p><div style="font-size: inherit; font-weight: inherit;"><br></div>
<p style="font-size: 11pt; font-weight: inherit; margin: 0px; line-height: normal; font-family: ''Lucida Grande''; color: rgb(16, 16, 16); min-height: 18px;"><br></p>
<p style="font-size: 16px; font-weight: inherit; margin: 0px 0px 13px; text-align: center; line-height: normal; font-family: Arial; color: rgb(16, 16, 16);"><span style="font-size: 18px;">&nbsp;</span><b>Die Bilder sind Teil der Beschreibung, bitte sehen Sie sich daher alle Fotos genau an. Leichte Farbabweichungen und Blitzeffekte sind vorbehalten.</b></p>
<p style="font-size: 18px; font-weight: inherit; margin: 0px 0px 13px; text-align: center; line-height: normal; font-family: Arial; color: rgb(16, 16, 16); min-height: 21px;"><br></p>
<p style="font-size: 18px; font-weight: inherit; margin: 0px 0px 13px; text-align: center; line-height: normal; font-family: Arial; color: rgb(16, 16, 16); min-height: 21px;"><br></p>
<p style="font-size: 18px; font-weight: inherit; margin: 0px; text-align: center; line-height: normal; font-family: ''Lucida Grande''; color: rgb(16, 16, 16);"><b>„Diese Ware unterliegt der Differenzbesteuerung. Daher wird die im Kaufpreis enthaltene Mehrwertsteuer in der Rechnung nicht gesondert ausgewiesen.“</b></p></div><div style="font-size: 11pt; font-weight: inherit;"><br></div><!-- Beginn des Händlerbund HTML-Codes für die Artikelbeschreibung -->
